import { Header, Input, InputContainer, Window } from "./Styles";

const AddModal = () => {
  return (
    <>
      <Window>
        <Header>New Employee</Header>
        <InputContainer>
          <Input />
          <Input />
          <Input />
          <Input />
          <Input />
        </InputContainer>
      </Window>
    </>
  );
};

export default AddModal;
